import React from 'react';
import List from './List';
import Sdata from './Sdata';
function App() {
  return (
    <>
      {Sdata.map((props) => {
        return (
          <List
            imgsrc={props.imgsrc}
            title={props.title}
            sname={props.sname}
            link={props.link}
          />
        );
      })}
    </>
  );
}

export default App;
